import Head from 'next/head';
const index = () => (
    <div>
        <head>
            <meta name="viewport"
                  content="initial-scale=1.0, width=device-width"
                  key="viewport"></meta>
            <title>内置Head组件</title>
        </head>
    </div>
)

export default index;
